    false,nt"url": null,nt"notes": "Marine mammal specimen and other data were
    collected from the SURVEYOR and other platforms from 10 February 1977 to 19 November
    1977. Data were collected by the Alaska State Department of Fish and Game as part
    of the Outer Continental Shelf Environmental Assessment Program (OCSEAP). Data were
    processed by NODC to the NODC standard F025 Marine Mammal Specimens format. Full
    format description ia available from the NODC homepage at www.nodc.noaa.gov/. An
    analog file for this accession is available from NODC user services.nnThe F025 format
    is designed to support studies of biological populations and ecosystems that are
    subject to impact from oil and gas development, marine pollution and other environmental
    disturbances. Information on marine animal populations, activities, migratory routes
    and breeding locales are obtained from either surface ship or aircraft surveys.nnThe
    F025 format contains data from examinations of marine mammal specimens. The data
    are collected to define behavior, population dynamics and trophic relationships
    of marine mammals. In addition to species, position, time and environmental conditions
    at the collection site, data for each specimen may include weight and body dimensions,
    sex and reproductive status, age, primary cause of death and analysis of stomach
    contents. The species of both the specimen and its ingested prey are encoded using
    the NODC Taxonomic Code. Comments may be reported in a free-text record.",nt"owner_org":
